import { IonAvatar, IonIcon, IonPage, IonTitle } from '@ionic/react';
import React from 'react';
import './header.css'
import imgas from '../images/Annotation 2024-01-23 201729.png';
import {heartOutline } from 'ionicons/icons';

function Headers(props) {
  return (
    <IonPage>
      <div className='header-container'>
        <p>Photogram</p>
        <img className='' src={imgas} onClick={null}>{}</img>
        <div className='header-container'>
          <ul className='header-ul'>
            <li><a href=''><IonIcon color='red' >{heartOutline}</IonIcon></a></li>
            <li><a href=''>adad</a></li>
          </ul>
        </div>
      </div>
    </IonPage>
  )
}

export default Headers
